// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract FlightInsurance1 {
    address public insuranceProvider;

    constructor() {
        insuranceProvider = msg.sender;
    }

    struct Policy {
        string passengerName;
        address passengerAddress;
        string flightNumber;
        string flightDate;
        string departureCity;
        string destinationCity;
        string status; // "purchased" or "claimed"
    }

    mapping(address => Policy) private policies;
    address[] private insuredPassengers;

    modifier onlyInsuranceProvider() {
        require(msg.sender == insuranceProvider, "Only the provider can call this.");
        _;
    }

    function viewAvailablePolicy() public pure returns (string memory) {
        return "Premium: 0.01 Ether, Indemnity: 0.02 Ether, Coverage: Hail, Flood";
    }

    function purchasePolicy(
        string memory name,
        string memory flightNumber,
        string memory flightDate,
        string memory departureCity,
        string memory destinationCity
    ) public payable {
        require(msg.value == 0.01 ether, "Must pay exactly 0.01 Ether.");
        require(policies[msg.sender].passengerAddress == address(0), "Policy already exists.");

        policies[msg.sender] = Policy({
            passengerName: name,
            passengerAddress: msg.sender,
            flightNumber: flightNumber,
            flightDate: flightDate,
            departureCity: departureCity,
            destinationCity: destinationCity,
            status: "purchased"
        });

        insuredPassengers.push(msg.sender);
        payable(insuranceProvider).transfer(msg.value);
    }

    function viewMyPolicy() public view returns (Policy memory) {
        require(policies[msg.sender].passengerAddress != address(0), "No policy found.");
        return policies[msg.sender];
    }

    function viewAllPolicies() public view onlyInsuranceProvider returns (Policy[] memory) {
        Policy[] memory all = new Policy[](insuredPassengers.length);
        for (uint i = 0; i < insuredPassengers.length; i++) {
            all[i] = policies[insuredPassengers[i]];
        }
        return all;
    }
}

